import React from "react";

const Docs = () => {
  return (
    <div>
      <h1>The Reel Ones API Documentation</h1>
      <h3>Introduction</h3>
      <p>
        Despite being a full stack application, The Real Ones offers an API with
        various endpoints, for various use cases for designing front end
        applications.
      </p>
    </div>
  );
};

export default Docs;
